    <div class="the-problem">
        <div class="container-inner mx-auto py-12 px-4 lg:px-0">
            <h2 class="text-center mb-12 heading-font text-3xl">“Just show me a basic example!”</h2>
            <p class="leading-loose tracking-normal text-lg mb-12">
                Often times, package or library documentation can be <strong>imcomplete</strong> or <strong>difficult to understand</strong>. “Just show me a basic example!”
                That’s exactly what I’ll do. We’ll go over how to use the package as well <strong>as practical examples</strong> that will help you integrate
                them into your applications quickly and easily.
            </p>

            <h2 class="font-bold heading-font mb-6 text-2xl">What you will get:</h2>

            <ul class="list-reset text-lg leading-normal">
                <li class="checklist ">Learn how to use the most popular Laravel packages in <strong>easy to understand</strong> HD screencasts.</li>
                <li class="checklist ">Each video will include <strong>practical code examples</strong> that will be available for download and use..</li>
                <li class="checklist ">Discover and make use of packages that you might have never heard of..</li>
                <li class="checklist ">Easily add more functionality to your existing Laravel applications.</li>
            </ul>

        </div>
    </div><!--end the the-problem-->
