                <dt class="font-bold mb-2">Where will it be released?</dt>
                <dd class="mb-8">
                    As soon as I finish it! Definitely subscribe to the email list (and to my YouTube channel and Twitter) to stay updated and
                    for free course previews and discounts.
                </dd>
                <dt class="font-bold mb-2">What packages will you cover?</dt>
                <dd class="mb-8">
                   I have a list that I will work through and refine as I go along. I will share that list via email and maybe even take recommendations
                    along the way.
                </dd>
                <dt class="font-bold mb-2">Why don’t you just put it on your YouTube channel?</dt>
                <dd class="mb-8">
